import { Link } from "react-router-dom";

const Contato = () => {
    return (
        <div className="container div-sobre">
            <div className="row">
                <form className="form-group">
                    {/* <input type="text" className="input form-control" placeholder="Digite seu Nome"></input>
                    <input type="text" className="input form-control" placeholder="Digite seu E-mail"></input>
                    <input type="text" className="input form-control" placeholder="Digite seu Telefone"></input>
                    <input type="text" className="input form-control" placeholder="Assunto"></input>
                    <input type="text" className="input form-control" placeholder="Mensagem"></input> */}
                    
                    <div className="form-group">
                        <label className="col-md-1"></label>
                        <div className="col-md-9">
                            <label className="control-label">Descrição</label>
                            <input type="text" className="form-control" name="descricao" id="descricao-variavel" value="" placeholder="Nome" />
                        </div>
                    </div>

                    <div className="form-group">
                        <div className="col-md-1">
                            <Link to="/"><button type="button" className="btn waves-effect waves-light m-t-20">Salvar</button></Link>
                        </div>
                    </div>
                    
                </form>
            </div>
        </div>
    );
};

export default Contato;
